import Layout from '../components/layout/layout';
import Hero from '../components/hero/hero';
import About from '../components/about/about';
import Explain from '../components/explain/explain';

export default () => (
  <Layout>
    <Hero />
    <About />
    <Explain />
  </Layout>
);
